def main():
	n,m = read()
	m -= 1
	perm = [0]*n
	lf = 0
	rt = n-1
	for i in range(n):
		if m >= 2**(n-i-2):
			perm[rt] = i+1
			rt -= 1
		else:
			perm[lf] = i+1
			lf += 1
		m %= 2**(n-i-2)
	write(perm)



