kaijo_memo = []
def kaijo(n):
	if(len(kaijo_memo) > n): return kaijo_memo[n]
	if(len(kaijo_memo) == 0): kaijo_memo.append(1)
	while(len(kaijo_memo) <= n): kaijo_memo.append(kaijo_memo[-1] * len(kaijo_memo) % MOD)
	return kaijo_memo[n]

gyaku_kaijo_memo = []
def gyaku_kaijo(n):
	if(len(gyaku_kaijo_memo) > n): return gyaku_kaijo_memo[n]
	if(len(gyaku_kaijo_memo) == 0): gyaku_kaijo_memo.append(1)
	while(len(gyaku_kaijo_memo) <= n): gyaku_kaijo_memo.append(gyaku_kaijo_memo[-1] * pow(len(gyaku_kaijo_memo),MOD-2,MOD) % MOD)
	return gyaku_kaijo_memo[n]

def nCr(n,r):
	if n == r: return 1
	if n < r or r < 0: return 0
	ret = 1
	ret = ret * kaijo(n) % MOD
	ret = ret * gyaku_kaijo(r) % MOD
	ret = ret * gyaku_kaijo(n-r) % MOD
	return ret

######Factorization######
def factorization(n):
	arr = []
	temp = n
	for i in range(2, int(-(-n**0.5//1))+1):
		if temp%i==0:
			cnt=0
			while temp%i==0: 
				cnt+=1 
				temp //= i
			arr.append([i, cnt])
	if temp!=1: arr.append([temp, 1])
	if arr==[]: arr.append([n, 1])
	return arr

#####MakeDivisors######
def make_divisors(n):
	divisors = []
	for i in range(1, int(n**0.5)+1):
		if n % i == 0:
			divisors.append(i)
			if i != n // i: 
				divisors.append(n//i)
	return divisors

#####MakePrimes######
def make_primes(N):
	max = int(math.sqrt(N))
	seachList = [i for i in range(2,N+1)]
	primeNum = []
	while seachList[0] <= max:
		primeNum.append(seachList[0])
		tmp = seachList[0]
		seachList = [i for i in seachList if i % tmp != 0]
	primeNum.extend(seachList)
	return primeNum

