# 区間更新のみ
class kukankousin:
	def __init__(self, n):
		self.n = n
		self.N0 = 2**(self.n-1).bit_length()
		self.data = [None]*(2*self.N0)
		self.INF = (-1, 2**31-1)

	# 区間[l, r+1)の値をxに書き換える
	# xは(t, value)という値にする (新しい値ほどtは大きくなる)
	def update(self, l, r, x):
		L=l+self.N0;
		R=r+self.N0
		while L<R:
			if R & 1:
				R-=1
				self.data[R-1]=x

			if L & 1:
				self.data[L-1]=x
				L+=1
			L>>=1;
			R>>=1


	# a_iの現在の値を取得
	def _query(self, k):
		k+=self.N0-1
		s=self.INF
		while k>=0:
			if self.data[k]:
				s=max(s, self.data[k])
			k=(k-1)//2
		return s


	# これを呼び出す
	def query(self, k):
		return self._query(k)[1]


